import styles from './ButtonMenu.module.scss'
import '../../../sours/icon/style.css'

interface ButtonMenuProps {
    handlers: (() => void)[],
    style: {
        background: string;
    }
}

export default function ButtonMenu(props: ButtonMenuProps) {

    return (
        <button
            className={styles['header-buttonMenu']}
            onMouseEnter={props.handlers[0]}
            onMouseLeave={props.handlers[1]}
            onClick={props.handlers[2]}
            style={props.style}
        >
            <i className='ic_menu'></i>
        </button>
    )
}
